export function toogleIsDataLoaded(panel) {
    switch(panel) {

        case 'leftPanel':
            console.log('left Action created');
            return {
                type: 'TOOGLE_ISDATALOADED_LEFTPANEL'
            }

        case 'rightPanel':
            return {
                type: 'TOOGLE_ISDATALOADED_RIGHTPANEL'
            }

        default:
            return;
    }
}

export function showWelcomePanel() {

    return  {
        type: 'SHOW_WELCOME'
    }

}

export function showSearchAndResults() {

    return {
        type: 'SHOW_SEARCH_AND_RESULTS'
    };


}

export function showVideoPlayer() {

    return {
        type: 'SHOW_VIDEO_PLAYER'
    };

}

export function setUser(value) {
    return {
        type: 'SET_USER',
        payload: {
            user: value
        }
    }
}
